import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom";

import "./index.css";

ReactDOM.render(
  <BrowserRouter basename={process.env.PUBLIC_URL || "lofrano-arts"}>
    <App />
  </BrowserRouter>,
  document.getElementById("root")
);
